import React from "react";
import { Navigate } from "react-router-dom";
import { useNavigate } from "react-router-dom";
import { useState } from "react";
import "./page1.css";
// import arr from "./page1";
// let arr2=[...arr];
const Page2 = () => {
  let navigate = useNavigate();
  let name1, value1;
  const [data, setData] = useState({
    length1: "",
    Breath: "",
    Area: "",
    AreaUnit: "",
    bhk: "",
    floor: "",
    Furnished: "",
    car: "",
    Lift: "",
    Electricity: "",
    Facing: "",
    // name:localStorage.getItem("name")
  });
  const handelInput1 = (e) => {
    name1 = e.target.name;
    value1 = e.target.value;
    setData({ ...data, [name1]: value1 });
  };

  const sendData1 = async (e) => {
    const {
      length1,
      Breath,
      Area,
      AreaUnit,
      bhk,
      floor,
      Furnished,
      car,
      Lift,
      Electricity,
      Facing,
    } = data;
    localStorage.setItem("length1", length1);
    localStorage.setItem("Breath", Breath);
    localStorage.setItem("Area", Area);
    localStorage.setItem("AreaUnit", AreaUnit);
    localStorage.setItem("bhk", bhk);
    localStorage.setItem("floor", floor);
    localStorage.setItem("Furnished", Furnished);
    localStorage.setItem("car", car);
    localStorage.setItem("Lift", Lift);
    localStorage.setItem("Electricity", Electricity);
    localStorage.setItem("Facing", Facing);
    navigate("/p3");
  };
  return (
    <>
      <div className="pg1cont">
        <h2 className="all">Add New Property</h2>

        <div className="comA">
          <span className="com">1.Basic Info</span>
          <span className="com" id="clr">
            2.Property Details
          </span>
          <span className="com">3.General info</span>
          <span className="com">4.Location Info</span>
        </div>
        <div className="page1inside">
          <div className="type">
            <div className="two">
              <h3>Length</h3>

              <input
                id="Breath"
                className="opt"
                placeholder=" Example:1000"
                onChange={handelInput1}
              ></input>
            </div>
            <div className="two">
              <h3>Breath</h3>

              <input
                id="Breath"
                className="opt"
                placeholder=" Example:1000"
                onChange={handelInput1}
              ></input>
            </div>
          </div>
          <div className="type">
            <div className="two">
              <h3>Total Area</h3>

              <input
                id="TotalArea"
                placeholder="  Example:7500"
                className="opt1"
                onChange={handelInput1}
              ></input>
            </div>
            {/* </div>
            <div className="type"> */}
            <div className="two">
              <h3>Area Unit</h3>

              <input
                id="Areaunit"
                className="opt"
                placeholder=" Area Unit"
                onChange={handelInput1}
              ></input>
            </div>
          </div>
          <div className="type">
            <div className="two">
              <h3>No of BHK</h3>

              <select
                id="NoofBhk"
                className="opt"
                onChange={handelInput1}
              >
                <option >Select No of BHK</option>
                <option value="1">1</option>
                <option value="2">2</option>
                <option value="3">3</option>
              </select>
            </div>

            
          




          
            {/* <div className="type"> */}
            <div className="two">
              <h3>Bank Loan</h3>

              <select
                id="BankLoan"
                className="opt"
                name="BankLoan"
                onChange={handelInput1}
              >
                <option value="yes">select Loan</option>
                <option value="yes">Yes</option>
                <option value="No">No</option>
              </select>
            </div>
          </div>
          <div className="btn">
            <a href="/p0">
              <button className="btn15">Cancel</button>
            </a>
            {/* <a href="/p2"> */}
            <button className="btn15" onClick={sendData1}>
              Save & Continue
            </button>
            {/* </a> */}
          </div>
        </div>
      </div>
    </>
  );
};
export default Page2;
